import React from 'react'
import {Link, link} from 'lucide-react';
const Product_mgmt_system = () => {
  return (
    <span className="ml-3 mt-3 text-2xl font-medium">Github Projects
        <span className="ml-auto font-light mr-3 mt-3">
          <a className="hover:underline hover:font-normal" href="">See All</a>
        </span>
        </span>
  )
}

export default Product_mgmt_system
